import React from "react";
import ChannelProfileStyled from "../styled/channelStyled/ChannelProfileStyled";
import UserName from "./UserName";
import UserBlockStlyed from "../styled/commonStyled/UserBlockStyled";

const UserBlock = () => {
  return (
    <UserBlockStlyed>
      <ChannelProfileStyled
        src="../../public/logo192.png"
        width="32px"
        height="32px"
      />
      <UserName />
    </UserBlockStlyed>
  );
};

export default UserBlock;
